//github.com/shubhamkarande/Bloggen",tech:["Next.js","Tailwind","Flask","PostgreSQL"]},{id:3,image:e9,title:"MindMerge  Synchronized Thinking, One Note at a Time",category:"Web",description:"MindMerge  Synchronized Thinking, One Note at a Time enables real-time collaborative note editing. Built with SvelteKit, Tailwind, and Vite. Backend runs Node.js with Socket.io on AWS Elastic Beanstalk, using Redis and PostgreSQL. Live sync lets users co-edit seamlessly. Frontend deployed on Netlify.",demoLink:"https://github.com/shubhamkarande/MindMerge",tech:["SvelteKit","Tailwind","Node.js","Socket.io"]},{id:4,image:t9,title:"Learnix  Stream. Learn. Grow.",category:"Web",description:"Learnix  Stream. Learn. Grow. is a video learning platform with courses, progress tracking, and quizzes. Built with Angular, Tailwind, and Vite. Backend uses Django REST on Azure App Service with MySQL. Videos hosted on Cloudinary or AWS S3. Stripe integration enables payments. Scalable, secure, and user-friendly.",demoLink:"https://github.com/shubhamkarande/Learnix",tech:["Angular","Tailwind","Django","MySQL"]},{id:5,image:n9,title:"DevTasker  Agile Board for Team Productivity",category:"Web",description:"DevTasker  Agile Board for Team Productivity is a Jira-style task manager with Kanban boards, user roles, and team invites. Built with React, Vite, Tailwind, Redux, and DnD Kit for smooth drag-and-drop. Backend is powered by ASP.NET Core on Azure with SQL Server. Designed for agile workflows and team collaboration.",demoLink:"https://github.com/shubhamkarande/DevTasker",tech:["React","Tailwind","ASP.NET","SQL Server"]},{id:6,image:r9,title:"Zer0Drop  Censorship-Free File Exchange",category:"Web",description:"Zer0Drop  Censorship-Free File Exchange is a decentralized file sharing app with Web3 wallet login and IPFS-based storage via Web3Storage. Built with Vue.js, Tailwind, and Vite. Backend uses Gin (Go) deployed on AWS Lambda. Enables censorship-resistant uploads and file minting, ensuring privacy, security, and permanence.",demoLink:"https://github.com/shubhamkarande/Zer0Drop",tech:["Vue.js","Tailwind","Go","IPFS"]},{id:7,image:o9,title:"Roofly  Explore Homes, From Anywhere",category:"Web",description:"Roofly  Explore Homes, From Anywhere is a real estate listing platform with search filters, maps, and image carousels. Built using Nuxt.js, Vite, and Tailwind for the frontend. Backend runs Laravel with a REST API on GCP App Engine and uses MySQL. Integrated with Leaflet or Google Maps API for property visualization.",demoLink:"https://github.com/shubhamkarande/Roofly",tech:["Nuxt.js","Tailwind","Laravel","MySQL"]},{id:8,image:a9,title:"BitPad  Fast, Collaborative Online Coding",category:"Web",description:"BitPad  Fast, Collaborative Online Coding is an online code playground to write, run, and share code snippets. Built with React, Vite, and Monaco Editor for an IDE-like experience. Backend uses Flask with Docker sandboxing on AWS Fargate. PostgreSQL stores user data and snippets. Lightweight, fast, and team-friendly.",demoLink:"https://github.com/shubhamkarande/BitPad",tech:["React","Monaco Editor","Flask","Docker"]},{id:9,image:i9,title:"Healio  A Smarter Way to Monitor Your Wellbeing",category:"Web",description:"Healio  A Smarter Way to Monitor Your Wellbeing is a personal health dashboard with BMI tracking, diet planning, and health goals. Built with Angular, Tailwind, and Chart.js. Backend uses Spring Boot on GCP Cloud Run, with PostgreSQL. An AI-powered FastAPI microservice provides wellness tips tailored to user data.",demoLink:"https://github.com/shubhamkarande/Healio",tech:["Angular","Chart.js","Spring Boot","PostgreSQL"]},{id:10,image:s9,title:"NomadHire  Freelancers Without Borders",category:"Web",description:"NomadHire  Freelancers Without Borders is a freelance marketplace with bidding, milestones, and real-time chat. Built using Svelte, Tailwind, and GSAP for rich UI animations. Backend is powered by Ruby on Rails on Azure App Service with 